import React, { Component } from 'react'

export default class Contact extends Component {
    render() {
        return (
            <section className={this.props.class ? this.props.class : `hidden`}>
                <div className={this.props.class ? `main-content_contact_content` : ``}>
                    <div className="main-content_contact_content_title">
                        <i class="fas fa-id-card"></i>
                        <h2>Contact me!</h2>
                    </div>
                    <ul className="main-content_contact_content_list">
                        <li><i class="fab fa-linkedin">https://www.linkedin.com/in/kamil-wojtas/</i></li>
                        <li><i class="far fa-envelope">k.wojtas172@gmail.com</i></li>
                        <li> <i class="fab fa-github">https://github.com/kwojtas172</i></li>
                    </ul>
                </div>
            </section>
        )
    }
}
